import React, { useEffect, useState } from "react";

const RegisterPage = () => {
  const [name, setName] = useState("");
  return (
    <div>
      <h3>Register</h3>
      <form>
        {name}
        <input value={name} onChange={(e) => setName(e.target.value)}></input>
      </form>
    </div>
  );
};

export default RegisterPage;
